import React, {useState, memo} from "react";
import "./App.css";

function Creatediv({width,height}){
  console.log("Hello message")
  return <div style={{width:width+"px" , 
                      height:height+"px",
                      backgroundColor:"red" 
          }}> A </div>
}
const CreatedivMemo = memo( Creatediv )

function App(){  
  const [count,setCount] = useState(0)
  const [width,setWidth] = useState(20)
  const [height,setHeight] = useState(20)
  const chnageWidth =(e)=>{ setWidth(e.target.value) }
  const chnageHeight=(e)=>{ setHeight(e.target.value) }



  return (
  <div className="App"> 
    Width : <input type="number" onChange={chnageWidth} /><br/>
    Height: <input type="number" onChange={chnageHeight} />
    {CreatedivMemo}
    <hr/>
    <button onClick={()=>setCount(count+1)}>add</button>  {count}
  </div>
  )
}

export default App;
